INSERT INTO BDMPROPERTIESBACKUP (PROPERTYID, CATEGORY, NAME, VALUE, TYPE, DEFAULTVALUE, DYNAMIC, VERSIONNO, LASTWRITTEN, BUILDDATETIME)  SELECT PROPERTYID, CATEGORY, NAME, VALUE, TYPE, DEFAULTVALUE, DYNAMIC, VERSIONNO, LASTWRITTEN, TO_DATE('@BUILDDATETIME@', 'yy-MM-dd HH24:MI:SS') AS BUILDDATETIME FROM  PROPERTIES 
